import React from 'react'
import { Formik, Form } from 'formik'
import FormikControl from './FormikControl'
import form from "./form.scss"

function RegistrationForm(props) {
  const { initialValues, validationSchema, onSubmit } = props;

  const responseSuccessGoogle = useCallback(
    async (response) => {
        try {
            let customer = await logOrRegisterCustomer(response);
            if (customer.message) {
                dispatch(setErors(customer.message));
            } else {
                dispatch(setCustomer(customer));
            }
        } catch (error) {
            dispatch(setErors(error.response));
        }
    },
    [dispatch]
);
const responseErrorGoogle = useCallback(
    async (response) => {
        dispatch(setErors(response.message));
    },
    [dispatch]
);

  return (
    <Formik
      initialValues={initialValues}
      validationSchema={validationSchema}
      onSubmit={onSubmit}
    >
      {formik => {
        return (
          // <div className="form__wrapper">
          // <h1>Registration form</h1>
          <Form>
            <FormikControl
              control='input'
              type='text'
              label='Please, enter your first name'
              name='firstName'
            />
            <FormikControl
              control='input'
              type='text'
              label='Please, enter your last name'
              name='lastName'
            />
            <FormikControl
              control='input'
              type='text'
              label='Please, enter your login'
              name='login'
            />
            <FormikControl
              control='input'
              type='email'
              label='Email'
              name='email'
            />
            <FormikControl
              control='input'
              type='password'
              label='Password'
              name='password'
            />
            <FormikControl
              control='input'
              type='password'
              label='Confirm Password'
              name='confirmPassword'
            />
            <button className="form__btn" type='submit' disabled={!formik.isValid}>
              Submit
            </button>
            <GoogleLogin
              clientId={configData.REACT_APP_GOOGLE_CLIENT_ID}
              buttonText="Login"
              onSuccess={responseSuccessGoogle}
              onFailure={responseErrorGoogle}
              cookiePolicy={"single_host_origin"}
            />
          </Form>
          // </div>
        )
      }}
    </Formik>
  )
}

export default RegistrationForm
